import React, { useContext, useState } from 'react';
import './Navbar.css';
import { Link } from 'react-router-dom';
import logo from '../Assets/logo.png';
import cart_icon from '../Assets/cart_icon.png';
import { ShopContext } from '../../Context/ShopContext';
import nav_dropdown from '../Assets/nav_dropdown.png';

const Navbar = () => {
  const [menu, setMenu] = useState(null);
  const { getTotalCartItems } = useContext(ShopContext);

  const handleMenuHover = (menuName) => {
    setMenu(menuName);
  };

  const handleMenuLeave = () => {
    setMenu(null);
  };

  return (
    <div className='nav'>
      <Link to='/' style={{ textDecoration: 'none' }} className="nav-logo">
        <img src={logo} alt="logo" />
        <p>SHOPPER</p>
      </Link>
      <div className="nav-dropdown">
        <ul className="nav-menu">
          <li onMouseEnter={() => handleMenuHover("shop")} onMouseLeave={handleMenuLeave}>
            <Link to='/' style={{ textDecoration: 'none' }}>Shop</Link>
            {menu === "shop" && (
              <div className="dropdown-content">
                <ul>
                  <li><Link to='/category1'>Category 1</Link></li>
                  <li><Link to='/category2'>Category 2</Link></li>
                  {/* Add more subcategories as needed */}
                </ul>
              </div>
            )}
          </li>
          <li onMouseEnter={() => handleMenuHover("mens")} onMouseLeave={handleMenuLeave}>
            <Link to='/mens' style={{ textDecoration: 'none' }}>Men</Link>
            {menu === "mens" && (
              <div className="dropdown-content">
                <ul>
                  <li><Link to='/mens/shirts'>Shirts</Link></li>
                  <li><Link to='/mens/pants'>Pants</Link></li>
                  {/* Add more subcategories as needed */}
                </ul>
              </div>
            )}
          </li>
          {/* Repeat the same pattern for other main options */}
        </ul>
        {menu && (
          <div className="secondary-menu">
            {/* Secondary menu options */}
            <div className="secondary-menu-option">
              {/* Example of secondary menu option */}
              <h3>Special Offers</h3>
              <ul>
                <li><Link to='/special-offer1'>Special Offer 1</Link></li>
                <li><Link to='/special-offer2'>Special Offer 2</Link></li>
                {/* Add more secondary menu options as needed */}
              </ul>
            </div>
            {/* Add more secondary menu options as needed */}
          </div>
        )}
      </div>
      <div className="nav-login-cart">
        {localStorage.getItem('auth-token')
          ? <button onClick={() => { localStorage.removeItem('auth-token'); window.location.replace("/"); }}>Logout</button>
          : <Link to='/login' style={{ textDecoration: 'none' }}><button>Login</button></Link>}
        <Link to="/cart"><img src={cart_icon} alt="cart" /></Link>
        <div className="nav-cart-count">{getTotalCartItems()}</div>
      </div>
    </div>
  );
};

export default Navbar;
